            circle.setAttribute('r', 10)
            drawing.append(circle)

        var remaining_objects = Object.keys(data).filter(key => !data[key].endpoint)
        var remaining_endpoints = {
            "0": Object.keys(data).filter(key => data[key].endpoint && data[key].interfaces["0"]),
            "1": Object.keys(data).filter(key => data[key].endpoint && data[key].interfaces["1"]),
            "2": Object.keys(data).filter(key => data[key].endpoint && data[key].interfaces["2"]),
            "3": Object.keys(data).filter(key => data[key].endpoint && data[key].interfaces["3"])
        } 

        var position = {x: 600, y: 900}
        var first = true
        
        function add_endpoint(interface, body_data, position){
            var opposite_interface = ((parseInt(interface) + 2 ) % 4).toString()
            if(body_data.interfaces[interface] && remaining_endpoints[opposite_interface].length>0){
                var if0_key = remaining_endpoints[opposite_interface][remaining_endpoints[opposite_interface].length * Math.random() << 0]
                var x_index = (parseInt(interface) + 1) %2
                var y_index = parseInt(interface) % 2
                var if0_pos = {x: position.x + body_data.interfaces[interface][x_index] * body_data.scale, y: position.y + body_data.interfaces[interface][y_index] * body_data.scale }
                
                var if0_path = document.getElementById(if0_key)
                svg.removeChild(if0_path)
                var if0_data = data[if0_key]
                if0_pos.x = if0_pos.x - if0_data.interfaces[opposite_interface][x_index] * if0_data.scale
                if0_pos.y = if0_pos.y - if0_data.interfaces[opposite_interface][y_index] * if0_data.scale
                if0_path.setAttribute('transform', `translate(${if0_pos.x} ${if0_pos.y}) scale(${if0_data.scale}) rotate(${if0_data.rotation} ${if0_data.width/2} ${if0_data.height/2})`)
                if0_path.setAttribute('visibility', "visible")
                if(interface === "0" || interface === "3"){
                    drawing.append(if0_path)
                } else {
                    drawing.prepend(if0_path)
                }
                remaining_endpoints[opposite_interface] = remaining_endpoints[opposite_interface].filter(element => element != if0_key)
            }
        }

            remaining_objects = remaining_objects.filter(element =>  element != random_key)
            drawing.prepend(path)
            // append endpoint to interface 0

            add_endpoint("2", random_data, position)
            if (first){
                add_endpoint("3", random_data, position)
                first = false
            }

            }
